import React from "react";
import Header from "../../Header/Header";
import RegisterDiv from "../../RegisterDiv/RegisterDiv";
import './style.css'
import build from '../build.svg'

function MainDiv() {
    return (
        <div id='mainDiv'>
            <Header />
            <img src={build} alt='Нема пикчи' id='build'></img>
            <RegisterDiv />
        </div>
    )
}

export default MainDiv
